function setGallery(){try{var a=document.getElementById("svGallery").getElementsByTagName("LI");var c=0;var e=0;for(var b=0;b<a.length;b++){if(jslib=="jquery"){e=getHeightJQuery(a[b])}else{e=getHeightPrototype(a[b])}if(e>c){c=e}}for(var b=0;b<a.length;b++){if(jslib=="jquery"){e=setHeightJQuery(a[b],c)}else{e=setHeightPrototype(a[b],c)}}}catch(d){}}function getHeightJQuery(a){return $(a).height()}function getHeightPrototype(a){return a.getHeight()}function setHeightJQuery(b,a){$(b).height(a)}function setHeightPrototype(b,a){b.style.height=a+"px"}addLoadEvent(setGallery);